import React, { Component } from 'react'
import './home.css'

export class home extends Component {
    constructor(props) {
        super(props)

        this.state = {
             search : ''
        }
    }

    searchValue=()=>{

        console.log(this.state.search)
    }

    render() {
        const {search} = this.state
        return (
                <div id="total">
                    <div class="container">
                        <div class="row">
                            <div class="col-lg-6">
                                <form>
                                    <div class="form-group">
                                        <input type="email" class="form-control" id="search" aria-describedby="emailHelp" placeholder="Search"></input>
                                    </div>
                                </form>
                            </div>
                            <div class="col-lg-6">
                                <button value = {search} onClick={this.searchValue} id="btn">Search</button>
                            </div>
                        </div>
                    </div>               





            </div>
        )
    }
}

export default home
